  false,\n\t\"url\": null,\n\t\"notes\": \"The Golden Gate LiDAR Project is a cooperative
  project sponsored by the US Geological Survey (USGS) and San Francisco State University
  (SFSU) that has resulted in the collection and processing of high resolution 2 meter
  nominal pulse spacing or better LiDAR and meet objectives of the American Recovery
  and Reinvestment Act (ARRA). The DEM data generated from the LiDAR will be added
  to The National Map, a set of national geospatial datasets available to the public
  at no cost. During the summer of 2010, we acquired LiDAR data for the counties and
  parks of the Marin and San Francisco Peninsulas. SFSU's Romburh Tiburon Center for
  Environmental Sciences and the Hyperspectral-LiDAR Research Lab at the Univ. of
  Victoria has orthorectified aerial photography and hyperspectral imagery respectably.
  The project extent is based upon the watershed boundaries for all watersheds that
  contain the lands of Marin County and San Francisco County. It also includes the
  watersheds that contain Point Reyes National Seashore and the Golden Gate National
  Recreation Area. The area of interest includes watersheds that are also located
  in southern Sonoma County and northern San Mateo County and when combined total
  ~835 square miles (planimetric estimate) of area (please refer to the map below).
  The project area includes the Marin Peninsula and San Francisco Peninsula that form
  the western edge of San Francisco Bay and San Pablo Bay. These peninsulas are north
  and south of the strait at the mouth of San Francisco Bay called the Golden Gate.
  This region is the northern part of the Central California coast. 3 data types:
  1)Classified LAS v1.2, by 1500 meter x 1500 meter tile, 2)Classified LAS v1.2 tiles
  with buffered (1m) breaklines embedded, 3) Classified LAS v1.3 tiles with waveform.
  These data are edited and classified as: 1 (unclassified) 2 (bare-earth, ground),
  4 (vegetation), 7 (noise), 9 (water) designates water in the tiles with breaklines
  embedded. Noise was removed for OCM storage as it was deemed unnecessary upon review.\",\n\t\"owner_org\":
